/**
 * 切换主题
 */
const changeTheme = (type = 'BimBlue') => {
  const campus = app.query('.Campus')[0];
  if (!campus) {
    console.error('暂无场景，无法继续');
    return;
  }
  if (currentTheme === type) return;
  if (THING.ThemeManager.findStyle(type)) {
    campus.applyTheme(type);
    currentTheme = type;
  }
};

/**
 * 销毁主题
 */
const tryDestroyTheme = () => {
  let campus = app.query('.Campus')[0];
  if (!campus) {
    console.error('暂无场景，无法继续');
    return;
  }
  const ctrl = app.getControl('effectThemeControl');
  if (!ctrl) return;
  themeList.forEach(theme => {
    if (THING.ThemeManager.findStyle(theme)) {
      campus.applyTheme(null);
      ctrl.destroyEffectTheme(theme, campus);
    }
  });
  const clonedLineList = campus.query('.ClonedLine');
  clonedLineList && clonedLineList.forEach(item => {
    item.visible = false;
    item.destroy();
  });
  const clonedFloorList = campus.query('.ClonedFloor');
  clonedFloorList && clonedFloorList.forEach(item => {
    item.visible = false;
    item.destroy();
  });
  app.skyBox = 'BlueSky';
  app.off(THING.EventType.EnterLevel, null, 'ThemeEnterLevelToUpdateEnv');
};

