// 接收消息监听后调用的方法
const businessOperation = (param) => {
  console.debug('titleChange2', param);
  console.debug('eye', param.type);
  if (param.type === 'initCampusView') { // 进入园区视角
    backNeedData.campus = app.query('Campus')[0];
    currentBuildingInfo = undefined;
    param.data.buildingList.forEach((item, index) => {
      createTitleImg(item.id, item.status);
    });
  } else if (param.type === 'initBuildingView') {
    // 用业务数据定位设备
    currentBuildingInfo = param.data.buildingInfo;
    const buildingInfo = param.data.buildingInfo;
    drawDeviceMarkerForBuildingView(buildingInfo.id, buildingInfo.floorList, buildingInfo.abnormalDeviceList);

    if (storagePartition.storageIds.length !== 0) {
      storagePartition.storageIds.forEach((item, index) => {
        app.query('#' + item)[0].destroy();
      });
      console.debug('***', '销毁分区');
      // 重置分区id存储
      storagePartition.storageIds = [];
    }
    if (storagePartition.storageTitleIds.length !== 0) {
      storagePartition.storageTitleIds.forEach((item, index) => {
        app.query('#' + item)[0].destroy();
      });
      console.debug('***', '销毁分区内标题');
      storagePartition.storageTitleIds = [];
    }
  } else if (param.type === 'initFloorView') {
    // 用业务数据定位设备
    currentFloorId = param.data.floorInfo.floorId;
    const floorInfo = param.data.floorInfo;
    drawDeviceMarkerForFloorView(currentBuildingId, floorInfo, floorInfo.abnormalDeviceList);
    let floorObj = app.query('#' + currentFloorId)[0];
    let centerPoint;
    let pointList;
    if (!floorObj) return;

    if (polygonCurrentFloorId !== currentFloorId) {
      locationInformationSimulationList.forEach((oneItem, index) => {
        pointList = oneItem.pointList.map(item => transformCoordinates(floorObj, floorInfo.width, floorInfo.height, item[0], item[1], 3.1));
        centerPoint = transformCoordinates(floorObj, floorInfo.width, floorInfo.height, oneItem.centerPoint[0], oneItem.centerPoint[1], 3.1);
        createFloorTagging(centerPoint, pointList, index, floorObj);
      });
    };
    // locationInformationSimulationList.forEach((oneItem, index)=>{
    //     pointList = oneItem.pointList.map(item => transformCoordinates(floorObj, floorInfo.width, floorInfo.height, item[0], item[1], 3.1))
    //     centerPoint = transformCoordinates(floorObj, floorInfo.width, floorInfo.height, oneItem.centerPoint[0], oneItem.centerPoint[1], 3.1);
    //     createFloorTagging(centerPoint, pointList, index, floorObj);
    // });
    polygonCurrentFloorId = currentFloorId;
  } else if (param.type === 'backToView') {
    if (param.data.viewType === 'CAMPUS') {
      app.level.change(backNeedData.campus);
    } else if (param.data.viewType === 'BUILDING') {
      app.level.change(backNeedData.building);
    }
  } else if (param.type === 'changeMapToFloor') {
    if (polygonCurrentFloorId !== currentFloorId) {
      if (storagePartition.storageIds.length !== 0) {
        storagePartition.storageIds.forEach((item, index) => {
          app.query('#' + item)[0].destroy();
        });
        console.debug('***', '销毁分区');
      }
      if (storagePartition.storageTitleIds.length !== 0) {
        console.debug('lili');
        storagePartition.storageTitleIds.forEach((item, index) => {
          app.query('#' + item)[0].destroy();
        });
        console.debug('***', '销毁分区内标题');
      }
    }
    // 接收到业务层进入楼层
    console.debug('titleChange', '接收到业务进入楼层');
    currentFloorId = param.data.floorId;
    fromWeb = true;
    floorViewFocusDeviceId = param.data.deviceId;
    backNeedData.floor = app.query('#' + param.data.floorId)[0];
    app.level.change(backNeedData.floor);
  } else if (param.type === 'changeFloorView') {
    currentFloorId = param.data.floorInfo.floorId;
    backNeedData.floor = app.query('#' + param.data.floorInfo.floorId)[0];
    app.level.change(backNeedData.floor);
  } else if (param.type === 'mouseOverFloor') {
    app.query('#' + currentBuildingInfo.id)[0].query('#' + param.data.floorId)[0].style.outlineColor = '#FF8000';
  } else if (param.type === 'mouseOutFloor') {
    app.query('#' + currentBuildingInfo.id)[0].query('#' + param.data.floorId)[0].style.outlineColor = null;
  } else if (param.type === 'resetMapView') {
    // flyToThing
    if (param.data.viewType === 'CAMPUS') {
      let thing = app.query('.Campus')[0];
      console.debug('eye2', app.query('.Plane')[0].style);
      //   flyToThing(thing);
      app.query('.Plane')[0].style.emissive = true;
      flyToThing(thing);
    } else if (param.data.viewType === 'BUILDING') {
      flyToThingById(currentBuildingId);
    } else if (param.data.viewType === 'FLOOR') {
      flyToThingById(currentFloorId);
    }
  }
};

