// 给建筑添加标题 面板
function createTitleImg (buildingId, status) {
  let buildingPlane;
  let customPosition;
  let buildingItem = app.query('#' + buildingId)[0]; // 根据建筑id获取建筑信息
  if (buildingItem.query('plane_marker').length) {
    locCustom = !!buildingItem.query('plane_marker')[0].position;
    buildingPlanebuildingPlane = buildingItem.query('plane_marker')[0];
    customPosition = app.query('plane_marker')[0].position;
    buildingPlanebuildingPlane.visible = false;
    buildingPlanebuildingPlane.style.opacity = 0;
  };
  // 设置图片
  let imgWidth = 32; let imgHeight = 56; let planeWidth = 100; let planeHeight = 56;
  let buildingOrientedBox = buildingItem.getOrientedBox(); // 根据建筑信息获取建筑包围盒宽高长
  let buildingSize = buildingItem.size; // 获取建筑的宽高长
  // X轴偏移量
  let xDeviation = (buildingOrientedBox.points[7][0] - buildingOrientedBox.points[6][0]) / 8;
  // Y轴偏移量
  let yDeviation = (buildingOrientedBox.points[6][2] - buildingOrientedBox.points[5][2]) / 8;
  planeWidth = buildingItem.name.length * 40 + 80;
  let imgUrl; // 根据设备状态给予图标
  if (status === 'ALARM') {
    imgUrl = buildingTitleImg.ALARM.src;
  } else if (status === 'NORMAL') {
    imgUrl = buildingTitleImg.NORMAL.src;
  } else if (status === 'FAULT') {
    imgUrl = buildingTitleImg.FAULT.src;
  };
  let img = new Image(imgWidth, imgHeight);
  img.crossOrigin = 'Anonymous';
  img.src = imgUrl;
  // 加载图片
  img.onload = function () {
    //    设置canvas
    let canvas = createCanvas({ image: img, text: buildingItem.name, planeWidth, planeHeight });
    let newImg = new Image(planeWidth, planeHeight);
    newImg.src = canvas.toDataURL('image/png');
    planePlane = app.create({
      type: 'Plane',
      id: buildingId + '_plane',
      width: planeWidth * 0.1,
      height: planeHeight * 0.1,
      //   parent: building,
      position: locCustom ? customPosition : [buildingOrientedBox.points[6][0] + xDeviation + planeWidth * 0.1 / 2, buildingOrientedBox.center[1] + buildingOrientedBox.size[1] / 2 + planeHeight / 2 * 0.1, buildingOrientedBox.points[6][2] - yDeviation],
      style: {
        image: newImg,
        opacity: 0.9,
        color: '#FFFFFF'
      },
      complete: ({ object }) => {
        clearThingTheme(object);
        allBuildingTitlePlane.push(buildingId + '_plane');
      }
    });
    // 楼排位于定位点后 自身旋转后按自身XY轴做偏移  再偏移半个楼牌宽度让中心点位于楼牌中心点拿到坐标再移回来
    let lightPositionCus;
    if (locCustom) {
      let rotate = buildingItem.query('#plane_marker')[0].angles[1];
      planePlane.rotateY(rotate);
      planePlane.translate([planeWidth / 2 * 0.1 - buildingPlanebuildingPlane.boxSize[0] / 2, buildingPlanebuildingPlane.boxSize[1] / 2, 0]);
      planePlane.translate([-planeWidth / 2 * 0.1 + imgWidth / 2 * 0.1, 0, 0]);
      lightPositionCus = planePlane.position;
      lightPositionCus[1] = lightPositionCus[1] + planeHeight / 2 * 0.1;
      planePlane.translate([planeWidth / 2 * 0.1 - imgWidth / 2 * 0.1, 0, 0]);
    };
    createLight(buildingId, lightPositionCus, status);
  };
}

// 创建楼牌titlecanvas内容
function createCanvas (param) {
  let canvas = param.canvas;
  let image = param.image;
  if (!param.canvas) {
    canvas = document.createElement('canvas');
    canvas.width = param.planeWidth;
    canvas.height = param.planeHeight;
  }
  let ctx = canvas.getContext('2d');
  // 图片尺寸：58 * 102
  ctx.drawImage(image, 0, 0, image.width, image.height);
  ctx.fillStyle = '#FFFFFF';
  ctx.font = '40px sans-serif';
  ctx.textBaseline = 'middle';
  ctx.fillText(param.text, 40, param.planeHeight / 2);
  return canvas;
}

// 设置聚光灯
function createLight (buildingId, lightPositionCus, status) {
  // 根据建筑信息获取定位信息
  let planeWidth = 1000; let planeHeight = 102;
  let buildingItem = app.query('#' + buildingId)[0]; // 根据建筑id获取建筑信息
  let buildingOrientedBox = buildingItem.getOrientedBox(); // 根据建筑信息获取建筑包围盒宽高长
  planeWidth = buildingItem.name.length * 40 + 80;
  let customPositionLookAt;
  let lightCustomPosition;
  if (locCustom) {
    lightCustomPosition = lightPositionCus;
    customPositionLookAt = [lightCustomPosition[0], buildingOrientedBox.center[1] + buildingOrientedBox.size[1] / 2, lightCustomPosition[2]];
  }
  // X轴偏移量
  let xDeviation = (buildingOrientedBox.points[7][0] - buildingOrientedBox.points[6][0]) / 8;
  // Y轴偏移量
  let yDeviation = (buildingOrientedBox.points[6][2] - buildingOrientedBox.points[5][2]) / 8;
  // 光源点定位
  let lightPosition = locCustom ? lightCustomPosition : [buildingOrientedBox.points[6][0] + xDeviation, buildingOrientedBox.center[1] + buildingOrientedBox.size[1] / 2 + planeHeight * 0.1, buildingOrientedBox.points[6][2] - yDeviation];
  // 光源朝向位置
  let lookAtPositon = locCustom ? customPositionLookAt : [buildingOrientedBox.points[6][0] + xDeviation, buildingOrientedBox.center[1] + buildingOrientedBox.size[1] / 2, buildingOrientedBox.points[6][2] - yDeviation];
  let lightStateColor;
  if (status === 'ALARM') {
    lightStateColor = '#FF0000';
  } else if (status === 'NORMAL') {
    lightStateColor = '#00FF7F';
  } else if (status === 'FAULT') {
    lightStateColor = '#EEC428';
  };
  // 创建聚光灯
  let dataObj = { // 光源属性设置
    'type': 'SpotLight',
    'lightAngle': 30, // 光照角度
    'intensity': 2, // 亮度
    'penumbra': 0, // 半影
    'castShadow': false, // 是否开启阴影
    'position': lightPosition, // 光源位置
    'color': '#FFFFFF', // 灯光颜色
    'distance': planeHeight * 0.1 + 5, // 光照距离
    'target': null, // 目标
    'helper': false, // 是否开启辅助线
    // 'inheritStyle': false, // 是否受父物体影响
    'follow': true // 是否开启跟随
  };
  // 创建聚光灯
  let spotLight = app.create(dataObj);
  spotLight.lightColor = lightStateColor;
  spotLight.lightAngle = '45';
  spotLight.lookAt(lookAtPositon);
}

/**
 * 摄像头聚焦物体ById
 * @param thing
 */
const flyToThingById = thingId => {
  const thing = app.query('#' + thingId)[0];
  thing && flyToThing(thing);
};

/**
 * 摄像头聚焦物体
 * @param thing
 */
const flyToThing = thing => {
  const flyTime = 1000;
  const camInfo = thing.userData.camInfo;
  if (!camInfo || !camInfo.eye || !camInfo.target) {
    const doFly = () => {
      app.camera.flyTo({
        // object: thing,
        target: campusView.target,
        position: campusView.position,
        xAngle: 40, // 绕物体自身X轴旋转角度
        yAngle: 0, // 绕物体自身Y轴旋转角度
        radiusFactor: 3, // 物体包围盒半径的倍数
        time: flyTime
      });
    };
    if (thing.loading) {
      thing.on('load', doFly);
      return;
    }
    doFly();
    return;
  }
  app.camera.flyTo({
    position: camInfo.eye,
    target: camInfo.target,
    time: flyTime,
    complete: () => {
      floorViewFocusDeviceId = undefined; // 清理聚焦id
    }
  });
};

/**
 * 清理物体主题
 * @param thing
 */
const clearThingTheme = thing => {
  thing.inheritAngles = false;
  thing.inheritPickable = false;
  thing.inheritPosition = false;
  thing.inheritScale = false;
  thing.inheritStyle = false;
  thing.inheritTheme = false;
  thing.inheritVisible = false;
  thing.applyTheme && thing.applyTheme();
};

