/**
 * 根据底图信息，将业务系统内设备坐标转换为thingJS的3D坐标
 * @param currentFloor 楼层物体对象
 * @param imgWidth 图纸宽度
 * @param imgHeight 图纸高度
 * @param posX 业务系统点位x坐标
 * @param posY 业务系统点位y坐标
 * @param floorHeight 层高
 */
const transformCoordinates = (currentFloor, imgWidth, imgHeight, posX, posY, floorHeight = 0) => {
  if (!posX || !posY) return [];
  const extentTopLeft = currentFloor.query('extent_top_left')[0];
  const extentTopRight = currentFloor.query('extent_top_right')[0];
  const extentBottomLeft = currentFloor.query('extent_bottom_left')[0];
  if (!extentTopLeft || !extentTopRight || !extentBottomLeft) return [];

  const center = [13537523.534311788, 4709260.854812222];
  const extent = [center[0] - imgWidth * 1000 / 2, center[1] - imgHeight * 1000 / 2, center[0] + imgWidth * 1000 / 2, center[1] + imgHeight * 1000 / 2];
  // 找到相对位置，y轴反向
  const ratioX = (posX - extent[0]) / (extent[2] - extent[0]);
  const ratioY = 1 - ((posY - extent[1]) / (extent[3] - extent[1]));
  // 确定openlayers内坐标系
  const a = [extentTopLeft.position[0], extentTopLeft.position[2]];
  const b = [extentBottomLeft.position[0], extentBottomLeft.position[2]];
  const c = [extentTopRight.position[0], extentTopRight.position[2]];

  // 相对openlayers的宽高
  const wx = ratioX * Math.sqrt((c[0] - a[0]) * (c[0] - a[0]) + (c[1] - a[1]) * (c[1] - a[1]));
  const hy = ratioY * Math.sqrt((b[0] - a[0]) * (b[0] - a[0]) + (b[1] - a[1]) * (b[1] - a[1]));

  // ab, ac两条直线方程
  const kab = (b[1] - a[1]) / (b[0] - a[0]);
  const bab = b[1] - kab * b[0];
  const kac = (c[1] - a[1]) / (c[0] - a[0]);
  const bac = c[1] - kac * c[0];

  // 根据圆形公式+ab直线，求目标p点在ab上的映射点pb
  const pba = kab * kab + 1;
  const pbb = 2 * bab * kab - 2 * a[1] * kab - 2 * a[0];
  const pbc = a[0] * a[0] + (bab - a[1]) * (bab - a[1]) - hy * hy;

  let pbx = (-pbb + Math.sqrt(pbb * pbb - 4 * pba * pbc)) / (2 * pba);
  if (pbx > Math.max(a[0], b[0]) || pbx < Math.min(a[0], b[0])) {
    pbx = (-pbb - Math.sqrt(pbb * pbb - 4 * pba * pbc)) / (2 * pba);
  }
  let pby = pbx * kab + bab;

  // 根据圆形公式+ac直线，求目标p点在ac上的映射点pc
  const pca = kac * kac + 1;
  const pcb = 2 * bac * kac - 2 * a[1] * kac - 2 * a[0];
  const pcc = a[0] * a[0] + (bac - a[1]) * (bac - a[1]) - wx * wx;

  let pcx = (-pcb + Math.sqrt(pcb * pcb - 4 * pca * pcc)) / (2 * pca);
  if (pcx > Math.max(a[0], c[0]) || pcx < Math.min(a[0], c[0])) {
    pcx = (-pcb - Math.sqrt(pcb * pcb - 4 * pca * pcc)) / (2 * pca);
  }
  let pcy = pcx * kac + bac;
  return [pcx + pbx - a[0], currentFloor.position[1] + floorHeight, pcy + pby - a[1]];
};

/**
 * 设备定位，将业务系统设备位置处理为3D模式坐标
 * @param currentFloor
 * @param imgWidth
 * @param imgHeight
 * @param device
 * @param markerType
 */
const tryLocateMarker = (currentFloor, imgWidth, imgHeight, device, markerType) => {
  console.debug('tryLocateMarker', currentFloor.id, imgWidth, imgHeight, device.posX, device.posY, markerType);
  if (!device.posX || !device.posY) return;
  const extentTopLeft = currentFloor.query('extent_top_left')[0];
  const extentTopRight = currentFloor.query('extent_top_right')[0];
  const extentBottomLeft = currentFloor.query('extent_bottom_left')[0];
  if (!extentTopLeft || !extentTopRight || !extentBottomLeft) return;

  const center = [13537523.534311788, 4709260.854812222];
  const extent = [center[0] - imgWidth * 1000 / 2, center[1] - imgHeight * 1000 / 2, center[0] + imgWidth * 1000 / 2, center[1] + imgHeight * 1000 / 2];
  // 找到相对位置，y轴反向
  const ratioX = (device.posX - extent[0]) / (extent[2] - extent[0]);
  const ratioY = 1 - ((device.posY - extent[1]) / (extent[3] - extent[1]));
  // 确定openlayers内坐标系
  const a = [extentTopLeft.position[0], extentTopLeft.position[2]];
  const b = [extentBottomLeft.position[0], extentBottomLeft.position[2]];
  const c = [extentTopRight.position[0], extentTopRight.position[2]];

  // 相对openlayers的宽高
  const wx = ratioX * Math.sqrt((c[0] - a[0]) * (c[0] - a[0]) + (c[1] - a[1]) * (c[1] - a[1]));
  const hy = ratioY * Math.sqrt((b[0] - a[0]) * (b[0] - a[0]) + (b[1] - a[1]) * (b[1] - a[1]));

  // ab, ac两条直线方程
  const kab = (b[1] - a[1]) / (b[0] - a[0]);
  const bab = b[1] - kab * b[0];
  const kac = (c[1] - a[1]) / (c[0] - a[0]);
  const bac = c[1] - kac * c[0];

  // 根据圆形公式+ab直线，求目标p点在ab上的映射点pb
  const pba = kab * kab + 1;
  const pbb = 2 * bab * kab - 2 * a[1] * kab - 2 * a[0];
  const pbc = a[0] * a[0] + (bab - a[1]) * (bab - a[1]) - hy * hy;

  let pbx = (-pbb + Math.sqrt(pbb * pbb - 4 * pba * pbc)) / (2 * pba);
  if (pbx > Math.max(a[0], b[0]) || pbx < Math.min(a[0], b[0])) {
    pbx = (-pbb - Math.sqrt(pbb * pbb - 4 * pba * pbc)) / (2 * pba);
  }
  let pby = pbx * kab + bab;

  // 根据圆形公式+ac直线，求目标p点在ac上的映射点pc
  const pca = kac * kac + 1;
  const pcb = 2 * bac * kac - 2 * a[1] * kac - 2 * a[0];
  const pcc = a[0] * a[0] + (bac - a[1]) * (bac - a[1]) - wx * wx;

  let pcx = (-pcb + Math.sqrt(pcb * pcb - 4 * pca * pcc)) / (2 * pca);
  if (pcx > Math.max(a[0], c[0]) || pcx < Math.min(a[0], c[0])) {
    pcx = (-pcb - Math.sqrt(pcb * pcb - 4 * pca * pcc)) / (2 * pca);
  }
  let pcy = pcx * kac + bac;
  drawDeviceMarker(currentFloor, device, [pcx + pbx - a[0], currentFloor.position[1], pcy + pby - a[1]], markerType);
};

/**
 * 将设备业务状态翻译为以下四种之一
 * alarm || abnormal || shield || normal
 * @param deviceStatus
 */
const getDeviceStyleStatus = deviceStatus => {
  let result = { status: 'normal', color: '#4AB4FF' };
  switch (deviceStatus) {
    case 'ALARM':
    case 'FIRE': result = { status: 'alarm', color: '#FF3E1E' }; break;
    case 'NORAML': result = { status: 'normal', color: '#4AB4FF' }; break;
    case 'SHIELD': result = { status: 'shield', color: '#A9A9A9' }; break;
    default: result = { status: 'abnormal', color: '#F49632' };
  }
  return result;
};

/**
 * 物体下创建marker
 * @param parentThing
 * @param stdeviceInfoatus
 * @param position
 * @param markerType
 */
const drawDeviceMarker = (parentThing, deviceInfo, position, markerType = 'ball') => {
  var obj = app.create({
    type: 'Thing',
    name: 'riten_device_marker',
    id: deviceInfo.deviceId,
    parent: parentThing,
    url: `/uploads/wechat/118885/file/campus_lucas/device_model_${markerType}/`,
    position,
    angle: 0,
    complete: ({ object }) => clearThingTheme(object)
  });
  obj.style.color = getDeviceStyleStatus(deviceInfo.status).color;
  obj.scale = markerType === 'ball' ? [5, 5, 5] : [2, 2, 2];
  obj.playAnimation('_normal_');
  // 为设备点位绘制 顶部图片牌 以及 infowindow
  if (markerType === 'beam') {
    // 绘制infowindow
    drawDeviceInfowindow(obj, deviceInfo);
    // 绘制顶部图片牌
    drawDeviceMarkerIconForBeam(obj, deviceInfo);
  }
};

/**
 * 光柱点位，绘制顶部图片牌
 * @param obj
 * @param deviceInfo
 */
const drawDeviceMarkerIconForBeam = (obj, deviceInfo) => {
  const deviceIconBgImage = new Image();
  deviceIconBgImage.src = '/uploads/wechat/118885/file/campus_lucas/device_model_beam/bg_device_icon.png';
  deviceIconBgImage.onload = () => {
    const deviceIconImage = new Image();
    deviceIconImage.src = `/uploads/wechat/118885/file/campus_lucas/device_model_beam/icon_device_${getDeviceStyleStatus(deviceInfo.status).status}.png`;
    deviceIconImage.onload = () => {
      const canvas = document.createElement('canvas');
      canvas.width = 512;
      canvas.height = 512;

      let ctx = canvas.getContext('2d');
      ctx.clearRect(0, 0, canvas.width, canvas.height);
      ctx.drawImage(deviceIconBgImage, 0, 0);
      ctx.drawImage(deviceIconImage, 176, 156, 160, 200);

      const newImg = new Image(canvas.width, canvas.height);
      newImg.src = canvas.toDataURL('image/png');
      const plane = app.create({
        type: 'Plane',
        height: 1, // 高度
        parent: obj,
        localPosition: [0, 2.5, 0], // 平面中心在世界坐标下的位置
        pivot: [0.5, 1],
        style: {
          image: newImg,
          opacity: 0.9,
          color: getDeviceStyleStatus(deviceInfo.status).color
        },
        complete: ({ object }) => {
          clearThingTheme(object);
          object.lookAt(app.camera);
        }
      });
    };
  };
};

/**
 * 绘制设备的两种看板
 * @param deviceThing
 * @param deviceInfo
 */
const drawDeviceInfowindow = (deviceThing, deviceInfo) => {
  // 设备鼠标移入的infowindow
  drawDeviceHoverInfowindow(deviceThing, deviceInfo);
  // 设备点位注册点击事件，点击后创建看板
  deviceThing.on('click', () => {
    // 设备鼠标点击的infowindow
    drawDeviceClickInfowindow(deviceThing, deviceInfo);
    // 聚焦设备
    flyToThing(deviceThing);
  });
};

/**
 * 绘制设备鼠标移入看板
 * @param deviceThing
 * @param deviceInfo
 */
const drawDeviceHoverInfowindow = (deviceThing, deviceInfo) => {
  const element = document.createElement('div');
  element.style = 'position: absolute; z-index: 100;';
  element.innerHTML =
    `<div class="device-infowindow-hover ${getDeviceStyleStatus(deviceInfo.status).status}">
    <div class="title text-ellipsis">
      <span>${deviceInfo.statusDesc} - ${deviceInfo.deviceName}</span>
    </div>
    <div class="date-time">
      <span>${deviceInfo.statusUpdDt ? moment(deviceInfo.statusUpdDt).format('YYYY-MM-DD HH:mm:ss') : '-'}</span>
    </div>
    <div class="response-time">
      <span class="response-time-value">23.2</span>
      <span>小时未响应</span>
    </div>
  </div>`;
  element.id = 'device_infowindow_hover_' + deviceInfo.deviceId;
  app.domElement.append(element);
  const startPos = [deviceThing.position[0] + 0.5, deviceThing.position[1] + 5.5, deviceThing.position[2]];
  const uiAnchor = app.create({
    type: 'UIAnchor',
    parent: deviceThing,
    element: element,
    position: startPos,
    pivot: [0.5, 1] //  [0,0]即以界面左上角定位，[1,1]即以界面右下角进行定位
  });
  uiAnchor.visible = false;
  // 设备点位注册鼠标移入事件
  deviceThing.on('mouseenter', (ev) => {
    uiAnchor.visible = true;
  });
  deviceThing.on('mouseleave', (ev) => {
    uiAnchor.visible = false;
  });
};

/**
 * 销毁设备鼠标点击看板
 */
const destroyClickInfowindow = () => {
  deviceClickInfowindow && deviceClickInfowindow.destroy();
  deviceClickInfowindowLine && deviceClickInfowindowLine.destroy();
  // 取消聚焦设备，看楼层
  flyToThingById(currentFloorId);
};

/**
 * 绘制设备鼠标点击看板
 */
const drawDeviceClickInfowindow = (deviceThing, deviceInfo) => {
  destroyClickInfowindow();
  const element = document.createElement('div');
  // 避让鼠标移入板块
  element.style = 'position: absolute; z-index: 100;';
  element.innerHTML =
    `<div class="device-infowindow-click">
    <div class="btn-close" onclick="destroyClickInfowindow()"></div>
    <div class="device-name text-ellipsis">${deviceInfo.deviceName}</div>
    <div class="device-info first">设备类型：${deviceInfo.typeName}</div>
    <div class="device-info">设备地址：${deviceInfo.iotGatewayId}</div>
    <div class="device-info">安装位置：${deviceInfo.location}</div>
    <div class="device-info">通讯编码：${deviceInfo.iotDeviceId}</div>
    <div class="device-status-title"><span>设备异常状况</span></div>
    <div class="device-history first">
      <span>2022/07/01 23:59:59</span>
      <span>火警告警</span>
    </div>
    <div class="device-history">
      <span>2022/07/01 23:59:5911</span>
      <span>火警告警</span>
    </div>
    <div class="device-history">
      <span>2022/07/01 23:59:59</span>
      <span>故障告警</span>
    </div>
  </div>`;
  element.id = 'device_infowindow_hover_' + deviceInfo.deviceId;
  app.domElement.append(element);
  console.debug('eye', element);
  const startPos = [deviceThing.position[0] + 0.5, deviceThing.position[1] + 5.5, deviceThing.position[2]];
  const endPos = [deviceThing.position[0] + 2, deviceThing.position[1] + 8, deviceThing.position[2]];
  deviceClickInfowindow = app.create({
    type: 'UIAnchor',
    parent: deviceThing,
    element: element,
    position: endPos,
    pivot: [0, 0] //  [0,0]即以界面左上角定位，[1,1]即以界面右下角进行定位
  });
  deviceClickInfowindowLine = app.create({
    type: 'Line',
    parent: deviceThing,
    pivot: [0, 0],
    points: [startPos, endPos]
  });
  deviceClickInfowindowLine.style.skipBoundingBox = true;
};
